  false,\n\t\"url\": null,\n\t\"notes\": \"This report describes the results of Prime
  Hook's 1994 Water Management. Program and delineates plans for 1995. 1994 marked
  the third year that asynchronous drawdowns were performed between the refuge's three
  impoundments. Asynchronous drawdowns have become part of a concerted effort to avoid
  repetitive yearly manipulations including similar dates for flooding, dewatering
  and/or performing soil manipulations that can result in a gradual decrease in the
  potential for greater food diversity and long term productivity as impoundments
  age.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
